import React, { useState, useEffect } from "react";

const App = () => {
  const [num, setnum] = useState(0);

  useEffect(() => {
    // alert("hii");
    document.title=`you clicked me `
  });

  return (
    <button
      onClick={() => {
        setnum(num + 1);
      }}
    >
      Click me {num}
    </button>
  );
};

export default App;
